import React from 'react';
import '../App.css';
import Boards from './Boards'

import Card from 'react-bootstrap/Card';


const Board = ({ board, onDelete, onToggle }) => {
    return (
        <div className='board'>
            <Card border="info" style={{ width: '30rem' }}>
                <Card.Header>
                    <p>Boards</p>
                </Card.Header>
                <Card.Body>
                    {Boards}
                </Card.Body>

            </Card>
        </div>
    )
}

export default Board;
